"use strict";(self.webpackChunksecurosys_docs=self.webpackChunksecurosys_docs||[]).push([[76467],{28453:(t,e,n)=>{n.d(e,{R:()=>o,x:()=>r});var a=n(96540);const i={},s=a.createContext(i);function o(t){const e=a.useContext(s);return a.useMemo((function(){return"function"==typeof t?t(e):{...e,...t}}),[e,t])}function r(t){let e;return e=t.disableParentContext?"function"==typeof t.components?t.components(i):t.components||i:o(t.components),a.createElement(s.Provider,{value:e},t.children)}},55238:(t,e,n)=>{n.r(e),n.d(e,{assets:()=>c,contentTitle:()=>r,default:()=>p,frontMatter:()=>o,metadata:()=>a,toc:()=>l});const a=JSON.parse('{"id":"Installation/Setup/UserGuide/Configuration/reference-configuration","title":"Reference config (v2.11.1)","description":"","source":"@site/hsm/Installation/Setup/UserGuide/3_Configuration/reference-configuration.md","sourceDirName":"Installation/Setup/UserGuide/3_Configuration","slug":"/Installation/Setup/UserGuide/Configuration/reference-configuration","permalink":"/hsm/Installation/Setup/UserGuide/Configuration/reference-configuration","draft":false,"unlisted":false,"tags":[],"version":"current","lastUpdatedAt":1741162132000,"frontMatter":{},"sidebar":"tutorialSidebar","previous":{"title":"XML-Configuration","permalink":"/hsm/Installation/Setup/UserGuide/Configuration/configuration"},"next":{"title":"Create","permalink":"/hsm/Installation/Setup/UserGuide/User/create"}}');var i=n(74848),s=n(28453);const o={},r="Reference config (v2.11.1)",c={},l=[];function d(t){const e={code:"code",h1:"h1",header:"header",pre:"pre",...(0,s.R)(),...t.components};return(0,i.jsxs)(i.Fragment,{children:[(0,i.jsx)(e.header,{children:(0,i.jsx)(e.h1,{id:"reference-config-v2111",children:"Reference config (v2.11.1)"})}),"\n",(0,i.jsx)(e.pre,{children:(0,i.jsx)(e.code,{className:"language-xml",children:'<?xml version="1.0" encoding="UTF-8"?>\n<primus version="2" minor="2" name="PRIMUS-HSM-MASTER" state="master" serialnumber="000000000">\n\t<system_time>2023-03-10 10:06:44 UTC</system_time>\n\t\x3c!-- external syslog (logserver) and audit server (cryptoserver) configuration --\x3e\n\t<syslog logserver="disabled" cryptoserver="enabled" gapless_auditlog="enabled">\n\t\t<syslog_level>6</syslog_level>\n\t\t\x3c!-- log level 1-6 --\x3e\n\t\t<crypto_level>6</crypto_level>\n\t\t\x3c!-- log level 1-6 --\x3e\n\t\t\x3c!-- settings for syslog --\x3e\n\t\t<syslog_address id="1"/>\n\t\t<syslog_size>50000</syslog_size>\n\t\t<syslog_port tcp="disabled">514</syslog_port>\n\t\t\x3c!-- TCP/UDP and port --\x3e\n\t\t<syslog_interface>2</syslog_interface>\n\t\t\x3c!-- interface 1-4 --\x3e\n\t\t\x3c!-- settings for security/audit log, note security log contains syslog msgs --\x3e\n\t\t<crypto_address id="1">10.10.2.205</crypto_address>\n\t\t<crypto_size>50000</crypto_size>\n\t\t<crypto_port tcp="enabled">514</crypto_port>\n\t\t\x3c!-- TCP/UDP and port --\x3e\n\t\t<crypto_interface>2</crypto_interface>\n\t\t\x3c!-- interface 1-4 --\x3e\n\t\t<ca_certificate base64="" sni="enabled"/>\n\t\t\x3c!-- TLS certificate --\x3e\n\t</syslog>\n\t\x3c!-- networking configuration --\x3e\n\t<network>\n\t\t\x3c!-- manual DNS resolver configuration --\x3e\n\t\t<resolv_config>\n\t\t\t<domain_name>mydomain.com</domain_name>\n\t\t\t\x3c!-- domain name --\x3e\n\t\t\t<nameserver_ipv4 id="1">10.10.2.200</nameserver_ipv4>\n\t\t\t<nameserver_ipv6 id="1"/>\n\t\t</resolv_config>\n\t\t\x3c!-- interface 1 configuration IP networks of all interfaces must be disjunct --\x3e\n\t\t<data dhcp="disabled" dhcp6="disabled">\n\t\t\t\x3c!-- disable DHCP for manual IP address setting --\x3e\n\t\t\t<autoNeg>enabled</autoNeg>\n\t\t\t\x3c!-- auto-negotiation --\x3e\n\t\t\t<lineSpeed>100</lineSpeed>\n\t\t\t\x3c!-- max.Ethernet speed --\x3e\n\t\t\t<fullDuplex>enabled</fullDuplex>\n\t\t\t<ipv4addr>10.10.1.11</ipv4addr>\n\t\t\t\x3c!-- IPv4 address --\x3e\n\t\t\t<ipv4mask>24</ipv4mask>\n\t\t\t\x3c!-- IPv4 netmask CIDR notation --\x3e\n\t\t\t<ipv4gate>0.0.0.0</ipv4gate>\n\t\t\t\x3c!-- optional gateway, dont use --\x3e\n\t\t\t<ipv6addr>::</ipv6addr>\n\t\t\t\x3c!-- Ipv6 address --\x3e\n\t\t\t<ipv6mask>0</ipv6mask>\n\t\t\t\x3c!-- IPv6 netmask --\x3e\n\t\t\t<ipv6gate>::</ipv6gate>\n\t\t\t\x3c!-- optional IPv6 gateway, dont use --\x3e\n\t\t</data>\n\t\t\x3c!-- interface 2 configuration IP networks of all interfaces must be disjunct --\x3e\n\t\t<management dhcp="disabled" dhcp6="disabled">\n\t\t\t<autoNeg>enabled</autoNeg>\n\t\t\t<lineSpeed>100</lineSpeed>\n\t\t\t<fullDuplex>enabled</fullDuplex>\n\t\t\t<ipv4addr>10.10.2.11</ipv4addr>\n\t\t\t<ipv4mask>24</ipv4mask>\n\t\t\t<ipv4gate>0.0.0.0</ipv4gate>\n\t\t\t<ipv6addr>::</ipv6addr>\n\t\t\t<ipv6mask>0</ipv6mask>\n\t\t\t<ipv6gate>::</ipv6gate>\n\t\t</management>\n\t\t\x3c!-- interface 3 configuration IP networks of all interfaces must be disjunct --\x3e\n\t\t<high-availability dhcp="disabled" dhcp6="disabled">\n\t\t\t<autoNeg>enabled</autoNeg>\n\t\t\t<lineSpeed>100</lineSpeed>\n\t\t\t<fullDuplex>enabled</fullDuplex>\n\t\t\t<ipv4addr>10.10.3.11</ipv4addr>\n\t\t\t<ipv4mask>24</ipv4mask>\n\t\t\t<ipv4gate>0.0.0.0</ipv4gate>\n\t\t\t<ipv6addr>::</ipv6addr>\n\t\t\t<ipv6mask>0</ipv6mask>\n\t\t\t<ipv6gate>::</ipv6gate>\n\t\t</high-availability>\n\t\t\x3c!-- interface 4 configuration IP networks of all interfaces must be disjunct --\x3e\n\t\t<redundancy dhcp="disabled" dhcp6="disabled">\n\t\t\t<autoNeg>enabled</autoNeg>\n\t\t\t<lineSpeed>100</lineSpeed>\n\t\t\t<fullDuplex>enabled</fullDuplex>\n\t\t\t<ipv4addr>10.10.4.11</ipv4addr>\n\t\t\t<ipv4mask>24</ipv4mask>\n\t\t\t<ipv4gate>0.0.0.0</ipv4gate>\n\t\t\t<ipv6addr>::</ipv6addr>\n\t\t\t<ipv6mask>0</ipv6mask>\n\t\t\t<ipv6gate>::</ipv6gate>\n\t\t</redundancy>\n\t\t\x3c!-- List of routing entries, max 32 ids per IPv4 and IPv6, only one default route! --\x3e\n\t\t<static_ipv4_route id="1">\n\t\t\t\x3c!-- increment ids for more routes --\x3e\n\t\t\t<network>0.0.0.0</network>\n\t\t\t\x3c!-- IPv4 network --\x3e\n\t\t\t<mask>0</mask>\n\t\t\t\x3c!-- IPv4 netmask CIDR --\x3e\n\t\t\t<gateway>10.10.1.1</gateway>\n\t\t\t\x3c!-- IPv4 gateway, within interface subnet --\x3e\n\t\t\t<interface>1</interface>\n\t\t\t\x3c!-- via interface --\x3e\n\t\t</static_ipv4_route>\n\t\t<static_ipv6_route id="1">\n\t\t\t<network>::</network>\n\t\t\t<mask>0</mask>\n\t\t\t<gateway>::</gateway>\n\t\t\t<interface>1</interface>\n\t\t</static_ipv6_route>\n\t</network>\n\t\x3c!-- services mapping configuration --\x3e\n\t<config_process>\n\t\t<single_port>disabled</single_port>\n\t\t\x3c!-- all traffic on interface 1, 2-3,(4) unused --\x3e\n\t\t<all_port>disabled</all_port>\n\t\t\x3c!-- all services on all interfaces --\x3e\n\t\t<redundancy>0</redundancy>\n\t\t\x3c!-- interface 4 redundant for interface 1-3, 0=off --\x3e\n\t\t<dual_redundancy>disabled</dual_redundancy>\n\t\t\x3c!-- use 2x2 redundancy --\x3e\n\t\t<bond_mode>1</bond_mode>\n\t\t\x3c!-- bonding mode 1=active-backup, 2=LACP slow, 3=LACP fast --\x3e\n\t\t<snmp_interface>2</snmp_interface>\n\t\t\x3c!-- snmp on interface --\x3e\n\t\t<password/>\n\t\t\x3c!-- snmp password --\x3e\n\t\t<snmp>enabled</snmp>\n\t\t\x3c!-- enable snmp --\x3e\n\t\t<backup>enabled</backup>\n\t\t\x3c!-- allow usb backup --\x3e\n\t\t<restore>enabled</restore>\n\t\t\x3c!-- allow usb backup restore --\x3e\n\t\t<local_clone>enabled</local_clone>\n\t\t\x3c!-- manual cloning --\x3e\n\t\t<remote_update>enabled</remote_update>\n\t\t\x3c!-- remote firmware update via Decanus Terminal --\x3e\n\t\t<modify_config>enabled</modify_config>\n\t\t\x3c!-- manual clones can modify configuration --\x3e\n\t\t<add_genesis>enabled</add_genesis>\n\t\t\x3c!-- allow to make copy of genesis card --\x3e\n\t\t<noise_source>1</noise_source>\n\t\t\x3c!-- choose noise source, default=1 (TRNG) 2 (AIS31)--\x3e\n\t\t<tilt_sensor>enabled</tilt_sensor>\n\t\t\x3c!-- enable logging of vibration sensor --\x3e\n\t</config_process>\n\t\x3c!-- JCE interface enable and configuration --\x3e\n\t<jce_process>\n\t\t<active>enabled</active>\n\t\t<port>2300</port>\n\t\t<interface>1</interface>\n\t</jce_process>\n\t\x3c!-- PKCS#11 interface enable and configuration --\x3e\n\t<pkcs_process>\n\t\t<active>disabled</active>\n\t\t<port>2310</port>\n\t\t<interface>1</interface>\n\t</pkcs_process>\n\t\x3c!-- MS crypto API new generation (CNG) interface enable and configuration --\x3e\n\t<mscng_process>\n\t\t<active>disabled</active>\n\t\t<port>2320</port>\n\t\t<interface>1</interface>\n\t</mscng_process>\n\t\x3c!-- Active synchronisation HA cloning (online clone) configuration --\x3e\n\t<ha_process>\n\t\t<active>disabled</active>\n\t\t<port>2330</port>\n\t\t<interface>3</interface>\n\t</ha_process>\n\t\x3c!-- Remote administration (Decanus) for device management configuration --\x3e\n\t<decanus_process>\n\t\t<active>enabled</active>\n\t\t<port>2340</port>\n\t\t<interface>2</interface>\n\t</decanus_process>\n\t\x3c!-- Security configuration, requires SO priviledges --\x3e\n\t<crypto_process>\n\t\t<master_url id="1">10.10.3.11</master_url>\n\t\t\x3c!-- HA master ip address(es) --\x3e\n\t\t<master_url id="2">10.10.1.11</master_url>\n\t\t<remote_ha_clone>enabled</remote_ha_clone>\n\t\t\x3c!-- active HA cloning enable --\x3e\n\t\t<max_user>1</max_user>\n\t\t\x3c!-- max number of users/partitions, must be <= licensed value --\x3e\n\t\t<max_so>10</max_so>\n\t\t\x3c!-- max number of SO role individuals, 2 of n (default n = 10) --\x3e\n\t\t<delete_user>disabled</delete_user>\n\t\t<setup_password_lifespan>72</setup_password_lifespan>\n\t\t\x3c!-- initial setup password life in hours --\x3e\n\t\t<login_attempt_threshold>100</login_attempt_threshold>\n\t\t\x3c!-- max number of failed logins in attempt reset time interval --\x3e\n\t\t<attempt_reset_time>300</attempt_reset_time>\n\t\t\x3c!-- attempt reset time interval, default 100 attempts in 300s --\x3e\n\t\t<login_lockout_time>300</login_lockout_time>\n\t\t\x3c!-- lock out time in s if attempts in interval are exceeded --\x3e\n\t\t<keystore_size_limit>150</keystore_size_limit>\n\t\t\x3c!-- max key store size in MB --\x3e\n\t\t<import_keys>disabled</import_keys>\n\t\t\x3c!-- enable key import on device --\x3e\n\t\t<export_keys>disabled</export_keys>\n\t\t\x3c!-- enable key export on device --\x3e\n\t\t<extract_keys>disabled</extract_keys>\n\t\t\x3c!-- enable wrapped key export on device --\x3e\n\t\t<crypto_log>enabled</crypto_log>\n\t\t\x3c!-- enable security/audit log --\x3e\n\t\t<clone_modify>enabled</clone_modify>\n\t\t\x3c!-- enable object generation on clones, disable = only on master --\x3e\n\t\t<user_config>enabled</user_config>\n\t\t\x3c!-- indicates license value --\x3e\n\t\t<invalidate_keys>disabled</invalidate_keys>\n\t\t\x3c!-- enable: deleted keys are not erased, but invalidated, erasure requires SO action --\x3e\n\t\t<verify_block_state>disabled</verify_block_state>\n\t\t\x3c!-- enable: verification of blocking state of key delegated to master, used for EKA/SKA --\x3e\n\t\t<client_api_access>enabled</client_api_access>\n\t\t\x3c!-- disable will reject new connections to keystore, brings device into maintenance state, previously crypto_access --\x3e\n\t\t<session_objects>enabled</session_objects>\n\t\t\x3c!-- enable session objects using device external key objects --\x3e\n\t\t<destroy_objects>enabled</destroy_objects>\n\t\t\x3c!-- enable deletion of keystore objects, disable: delete will fail --\x3e\n\t\t<use_objects>enabled</use_objects>\n\t\t<trust_store>disabled</trust_store>\n\t\t\x3c!-- certificates reported as trusted --\x3e\n\t\t<keystore_size_limit>0</keystore_size_limit>\n\t\t<pkcs_password state="value"/>\n\t\t\x3c!-- set a default PIN for PKCS#11 --\x3e\n\t\t\x3c!-- Partition configuration --\x3e\n\t\t<crypto_user state="enabled">\n\t\t\t\x3c!-- enabled=user config, disabled=device config --\x3e\n\t\t\t<user_name>PART001</user_name>\n\t\t\t\x3c!-- partition name --\x3e\n\t\t\t<management>disabled</management>\n\t\t\t\x3c!-- allow Decanus partition management --\x3e\n\t\t\t<size_limit>0</size_limit>\n\t\t\t<setup_password_lifespan>72</setup_password_lifespan>\n\t\t\t<import_keys>disabled</import_keys>\n\t\t\t<export_keys>disabled</export_keys>\n\t\t\t<extract_keys>disabled</extract_keys>\n\t\t\t<clone_modify>disabled</clone_modify>\n\t\t\t<read_only>disabled</read_only>\n\t\t\t\x3c!-- enable: no new keys can be added to object keystore (create,import key fail) --\x3e\n\t\t\t<invalidate_keys>disabled</invalidate_keys>\n\t\t\t<verify_block_state>disabled</verify_block_state>\n\t\t\t<key_authorization>disabled</key_authorization>\n\t\t\t\x3c!-- enable SKA policies on keys --\x3e\n\t\t\t<rest_api>disabled</rest_api>\n\t\t\t\x3c!-- enable access through rest api --\x3e\n\t\t\t<tsb_engine>disabled</tsb_engine>\n\t\t\t\x3c!-- enable access by transaction security broker --\x3e\n\t\t\t<client_api_access>enabled</client_api_access>\n\t\t\t\x3c!-- disable to take user/partition offline --\x3e\n\t\t\t<session_objects>enabled</session_objects>\n\t\t\t<destroy_objects>enabled</destroy_objects>\n\t\t\t<use_objects>enabled</use_objects>\n\t\t\t<trust_store>disabled</trust_store>\n\t\t\t<userlog>disabled</userlog>\n\t\t\t\x3c!-- partition specific logging --\x3e\n\t\t\t<userlog_size>12000</userlog_size>\n\t\t\t<userlog_level>6</userlog_level>\n\t\t\t<pkcs_password>PRIMUSDEV</pkcs_password>\n\t\t\t\x3c!-- set partition PIN for PKCS#11, default = none --\x3e\n\t\t\t<jce_allowed>enabled</jce_allowed>\n\t\t\t\x3c!-- enable JCE interface on partition --\x3e\n\t\t\t<pkcs_allowed>enabled</pkcs_allowed>\n\t\t\t\x3c!-- enable PKCS#11, interface on partition --\x3e\n\t\t\t<mscng_allowed>enabled</mscng_allowed>\n\t\t\t\x3c!-- enable CNG interface on partition --\x3e\n\t\t</crypto_user>\n\t</crypto_process>\n\t\x3c!-- List of time servers (ntp) --\x3e\n\t<ntp state="enabled">\n\t\t\x3c!-- enable ntp protocol --\x3e\n\t\t<server id="1">10.10.2.201</server>\n\t\t\x3c!-- ntp url or ip address --\x3e\n\t\t<interface>2</interface>\n\t\t\x3c!-- ntp via interface --\x3e\n\t\t<ntp_pool>disabled</ntp_pool>\n\t\t\x3c!-- enable NTP pool addresses --\x3e\n\t</ntp>\n</primus>\n'})})]})}function p(t={}){const{wrapper:e}={...(0,s.R)(),...t.components};return e?(0,i.jsx)(e,{...t,children:(0,i.jsx)(d,{...t})}):d(t)}}}]);